import{_ as p}from"./plugin-vue_export-helper-c27b6911.js";import{o as _,c as e,e as t}from"./app-60a1dd49.js";const o={},c=t("<p>《三命通会》卷 九·六己日癸酉时断</p><p>六己日生时癸酉，沐浴之乡水土浑；</p><p>财食支藏多聚散，身衰失地寿难存。</p><p>己日癸酉时，水土浑浊。</p><p>己以癸为财，辛为食。</p><p>酉上癸病，辛旺，比肩夺财，财多聚散；更身衰失地，主成败反复；不然，寿促。</p><p>若通身旺月或运，吉。</p><p>己丑日癸亥时，春平；夏稳；秋伤官伤尽，有威权；冬富。</p><p>如丙寅巳月，金神遇火，贵。</p><p>丑月，金水运，郎官。</p><p>透乙，大贵。</p><p>己卯日癸酉时，时日相逢卯酉，主迁移；刑伤又伤官带煞，主性凶暴，作事迟延。</p><p>生四季月，吉。</p><p>己巳日癸酉时，巳酉丑月，伤官伤尽，居武职、风宪。</p><p>卯戌月，金神入火乡，贵而能言，伤贵，收心早退，以水土败在酉故也。</p><p>己未日癸酉时，戌亥丑辰年月，西方运，贵。</p><p>子巳大贵。</p><p>卯、辰，近侍不大。</p><p>己酉日癸酉时，偏财遇食，主峥嵘。</p><p>丑未子午俱吉。</p><p>酉月、内戚。</p><p>如年月己酉全，犯破碎煞，主一生破败，游走无结果。</p><p>己亥日癸酉时，通土气月，行木火运，贵。</p><p>己逢癸水酉时生，食神生旺自从容；身弱更兼冲克破，此命依算只中平。</p><p>己日时逢癸酉，偏财喜遇食神。</p><p>雁行无倚靠双亲，性格情怀不定。</p><p>财来财去聚散，眼前广见难存。</p><p>花开花谢再重新，此命先逆后顺。</p>",28),r=[c];function s(n,a){return _(),e("div",null,r)}const f=p(o,[["render",s],["__file","236卷 九·六己日癸酉时断.html.vue"]]);export{f as default};
